DROP TABLE IF EXISTS `shopping_order_info`;
CREATE TABLE `shopping_order_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单编号',
  `seller_mini_id` int(11) NOT NULL COMMENT '卖家唯一标识id',
  `order_status` int(11) NOT NULL COMMENT '订单状态:1未付款 2待取货 3已完成 4已取消 5申请退货中 6退货中 7退款中 8已退货',
  `goods_amount` int(11) NOT NULL COMMENT '商品总数',
  `purchase_price` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '成交总价格',
  `shop_profit` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '门店总返利',
  `picking_code` int(11) NOT NULL COMMENT '取货编码(四位整数)',
  `pay_type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '支付方式',
  `pay_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '支付时间',
  `finish_time` timestamp NULL DEFAULT NULL COMMENT '取货完成时间',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `openid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '买家微信openid',
  `nickname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '买家微信昵称',
  `avatarUrl` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '买家微信头像地址',
  `operator_mini_id` int(11) DEFAULT NULL COMMENT '操作人唯一标识id',
  `out_trade_no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '支付订单号',
  `shop_id` int(11) NOT NULL COMMENT '卖家店铺id',
  `buyer_phone` char(11) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '买家手机号',
  `phone` char(11) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '买家手机号',
  `pick_time` int(11) NOT NULL DEFAULT '1' COMMENT '0今日达1明日达',
  `arrvial_good_notice` tinyint(4) NOT NULL DEFAULT '0' COMMENT '收获发送状态，0未发送，1发送成功，2发送失败',
  `print_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '打印状态，0 打印成功，1 打印失败',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `nick` (`picking_code`,`nickname`) USING BTREE,
  KEY `result` (`seller_mini_id`,`order_status`,`pay_time`,`purchase_price`,`shop_profit`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=631 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

